public static class ClientImageSeedData
{
    public static byte[] StringToByteArray(string hex)
    {
        hex = hex.Substring(2);
        int cnt = hex.Length;

        byte[] bytes = new byte[cnt / 2];

        for (int i = 0; i < cnt; i += 2)
            bytes[i / 2] = Convert.ToByte(hex.Substring(i, 2), 16);

        return bytes;
    }

